@mzelesky : From @jmeyer4 

Response from Marie:  "As far as the project goes as long as I am in the loop in regard to amount of carts to send and when, all is good.
For the barcode issue, we only change the barcode on items that have NO barcode on front cover. I think Mark was thinking of items that are being withdrawn from ReCAP for one reason or another. For those we routinely change the barcode to not create confusion in the future, but that wouldn’t be the case for your project.  Hope this clears that up."
